// ==================== HELPER FUNCTION ====================
export function getRoomAscii(roomName) {
  // Convierte room dirName al formato de las claves
  const key = roomName.toUpperCase().replace(/\\/g, '_').replace(/\s+/g, '_');
  return ROOM_ASCII[key] || '';
}

export function getFileAscii(fileName) {
  const key = fileName.toUpperCase().replace(/\./g, '_');
  return FILE_ASCII[key] || '';
}